De in 1969 tot stand gekomen verdelingswet regelde de uitkering aan de volgende categorieën:   


Obligatiehouders (afgedaan in 1974);


Natuurlijke personen (afgedaan in 1978);


Rechtspersonen.

appraisal.p:
Waardering heeft plaatsgevonden op grond van:    


Selectielijst voor de neerslag van de handelingen van de minister van Buitenlandse Zaken en de onder hem ressorterende actoren op het beleidsterrein Buitenland over de periode 1945-1990, vastgesteld bij besluit van 9 september 2002/nr. C/S/2002/2848, Stcrt. van 14 november 2002, nr.220;


Selectielijst voor de neerslag van de handelingen van de minister van Buitenlandse Zaken en de onder hem ressorterende actoren op het beleidsterrein Organisatie van de Rijksoverheid over de periode 1945-1999, vastgesteld bij besluit van 5 juli 2005/Nr. C/S&A/05/1197, STCRT. van 16 december 2005, nr. 245.

Na advies van de Archiefcommissie worden ook de onderstaande handelingen van de selectielijst op het beleidsterrein Buitenland op grond van art. 5 lid e van het Archiefbesluit volledig bewaard:   


Handeling 90: uitvoeringsdossiers inzake uitkeringen tot schadeloosstelling van Nederlandse belangen in Egypte welke door nationalisaties en dergelijke zijn getroffen ten gevolge van het Compensatieaccoord Egypte;


Handeling 99: dossiers inzake het verzorgen van uitkeringen tot schadeloosstelling van Nederlandse belangen in de Duitse Democratische Republiek welke door nationalisaties en dergelijke zijn getroffen.

odd.p:
Nota bene: N.S. Blom was:
- regeringscommissaris voor Indonesische aangelegenheden, van 1 december 1952 - 1 april 1964;
- directeur-generaal directoraat-generaal Indonesië (DGIN), van 1 mei 1955 - 1 januari 1965;
- gevolmachtigd ambassadeur, voorzitter Nederlandse delegatie van de gemengde commissie voor hangende financiële vraagstukken tussen Nederland en Indonesië, van 1965 - 15 augustus 1966
